import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage'; // Import the new RegisterPage
import Dashboard from './pages/Dashboard';
import ResidentPortal from './pages/ResidentPortal';
import GuestPortal from './pages/GuestPortal';

// back-end-port=5000; added this block of code to accept request from different orgin (front-end-port=3000)
const API_URL = 'http://localhost:5000/api'; // Ensure this matches your backend server's URL

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} /> {/* Add this line */}
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/resident-portal" element={<ResidentPortal />} />
        <Route path="/guest-portal" element={<GuestPortal />} />
      </Routes>
    </Router>
  );
}

export default App;
